From the provided image, it appears to be a specific section of an Executive Document Summary form related to a contract between the Indiana State Department of Health and a contractor named Three Sixty Group Inc. The details included are primarily focused on the professional services contract.

Here is a detailed breakdown in JSON format:

```json
{
  "contract": {
    "number": "00000000000000000000000000041057",
    "title": "Professional Services Contract",
    "parties": {
      "state": "Indiana State Department of Health",
      "contractor": "Three Sixty Group Inc"
    }
  },
  "details": {
    "duties_of_contractor": "The Contractor shall create all assets for the partnership, share with the IHSAA for approval, and then present in behalf of, on in tandem with, the IHSAA for approval with ISDH/TPC. This project is described fully in Attachment A, attached hereto, and made a part hereof and incorporated herein by reference as part of this Contract.",
    "consideration": "The Contractor will be paid using the rate(s) set out in Attachment B for performing the duties set forth above. Total remuneration under this Contract shall not exceed $250,000.00.",
    "term": "This contract shall commence on March 01, 2020 and shall remain in effect through February 28, 2021.",
    "access_to_records": "The Contractor and its subcontractors, if any, shall maintain all books, documents, papers, accounting records, and other evidence pertaining to all costs incurred under this Contract. They shall make such materials available at their respective offices at all reasonable times during this Contract, and for three (3) years from the date of final payment under this Contract, for inspection by the State or its authorized designees. Copies shall be furnished at no cost to the State if requested.",
    "assignment_successors": "The Contractor binds its successors and assignees to all the terms and conditions of this Contract. The Contractor shall not assign or subcontract the whole or any part of this Contract without the State's prior written consent. The Contractor may assign its right to receive payments to such third parties as the Contractor may desire without the prior written consent of the State, provided that the Contractor gives written notice (including evidence of such assignment) to the State thirty (30) days in advance of any payment so assigned. The assignment shall cover all unpaid amounts under this Contract and shall not be made to more than one party.",
    "assignment_of_antitrust_claims": "As part of the consideration for the award of this Contract, the Contractor assigns to the State all right, title, and interest in and to any claims the Contractor now has, or may acquire, under state or federal antitrust laws relating to the products or services which are the subject of this Contract."
  }
}
```

